粘着シート取付<br><br>ミッキーマウスのアイコンがおしゃれでクールなスマホポケットです。<br>画面が大きなスマートフォンにジャストフィットする便利でシンプルなポケットです。<br>取り付け簡単！ 粘着テープで貼るだけです。取付場所が広がるステー付き。<br>よりフィット感が出せるクッション構造にガタつき防止のスペーサー付き。<br>画面の操作がしやすい前面形状、底面にコネクター差し込み用切り欠き、コードフック付き。許容重量：200g以下<br>収納寸法：収納物の幅65mm以上、85mm以下　収納物の厚み15mm以下<br>※ iPhone4、5シリーズには使用できません。<br><br><br>●製品寸法 高×幅×厚(mm)：75×93×24<style type="text/css">
